CAT:
//https://www.celestrak.com/satcat/satcat-format.php

enum objectType: byte  {
  ///0
  PAYLOAD,
  ///1
  ROCKET_BODY,
  ///2
  DEBRIS,
  ///3
  UNKNOWN
}

enum opsStatusCode: byte {
  ///+
  OPERATIONAL,
  ///-
  NONOPERATIONAL,
  ///P
  PARTIALLY_OPERATIONAL,
  ///B
  BACKUP_STANDBY,
  ///S
  SPARE,
  ///X
  EXTENDED_MISSION,
  ///D
  DECAYED,
  ///?
  UNKNOWN
}

enum dataStatusCode: byte {
  ///NCE
  NO_CURRENT_ELEMENTS,
  ///NIE
  NO_INITIAL_ELEMENTS,
  ///NEA
  NO_ELEMENTS_AVAILABLE,
  ///OK
  OK
}

enum orbitType: byte {
  ///0
  ORBIT,
  ///1
  LANDING,
  ///2
  IMPACT,
  ///3
  DOCKED,
  ///4
  ROUNDTRIP
}

enum massType: byte {
  DRY,
  WET
}

table CAT {
  OBJECT_NAME:string;
  OBJECT_ID:string;
  NORAD_CAT_ID:uint;
  OBJECT_TYPE:objectType = UNKNOWN;
  OPS_STATUS_CODE:opsStatusCode = UNKNOWN;
  OWNER:string;
  LAUNCH_DATE:string;
  LAUNCH_SITE:string;
  DECAY_DATE:string;
  PERIOD:double;
  INCLINATION:double;
  APOGEE:double;
  PERIGEE:double;
  RCS:double;
  DATA_STATUS_CODE:dataStatusCode;
  ORBIT_CENTER: string;
  ORBIT_TYPE:orbitType;
  DEPLOYMENT_DATE:string;
  MANEUVERABLE:bool;
  SIZE:double;
  MASS:double;
  MASS_TYPE:massType = DRY;
}

table CATCOLLECTION {
  RECORDS:[CAT];
}

root_type CAT;
file_identifier "$CAT";

OMM:
enum referenceFrame : byte {
/// Earth Mean Equator and Equinox of J2000
EME2000,
///  Geocentric Celestial Reference Frame
GCRF,
/// Greenwich Rotating Coordinates
GRC,
/// International Celestial Reference Frame
ICRF,
/// International Terrestrial Reference Frame 2000
ITRF2000,
/// International Terrestrial Reference Frame 1993
ITRF93, 
/// International Terrestrial Reference Frame 1997
ITRF97,
/// Mars Centered Inertial
MCI,
/// True of Date, Rotating
TDR,
/// True Equator Mean Equinox
TEME,
/// True of Date
TOD, 
}

enum ephemerisType : byte {
 /// Simplified General Perturbation Model 
 SGP,
 /// Simplified General Perturbation Model  4
 SGP4,
 /// Simplified Deep Space Perturbation Model 4 
 SDP4,
 /// Simplified General Perturbation Model 8
 SGP8,
 /// Simplified Deep Space Perturbation Model 8
 SDP8
}

enum timeSystem : byte {
  /// Greenwich Mean Sidereal Time
  GMST,
  /// Global Positioning System
  GPS,
  /// Mission Elapsed Time
  MET,
  /// Mission Relative Time
  MRT,
  /// Spacecraft Clock (receiver) (requires rules for interpretation in ICD)
  SCLK,
  /// International Atomic Time
  TAI,
  /// Barycentric Coordinate Time
  TCB,
  /// Barycentric Dynamical Time
  TDB,
  /// Geocentric Coordinate Time
  TCG,
  /// Terrestrial Time
  TT,
  /// Universal Time
  UT1,
  /// Coordinated Universal Time 
  UTC
}

enum meanElementTheory : byte {
  /// Simplified General Perturbation Model  4
  SGP4,
  /// Draper Semi-analytical Satellite Theory
  DSST,
  /// Universal Semianalytical Method
  USM
}

enum manCovRefFrame : byte {
  // Another name for ‘Radial, Transverse, Normal’
  RSW,
  // Radial, Transverse, Normal
  RTN,
  // A local orbital coordinate frame (x velocity vec., w orbital angular momentum vec., N completes right handed system.)
  TNW
}

table OMM {
  // OMM Header
  CCSDS_OMM_VERS:double;
  CREATION_DATE:string;
  ORIGINATOR:string;

  // OMM Metadata
  OBJECT_NAME:string;
  OBJECT_ID:string;
  CENTER_NAME:string;
  REF_FRAME:referenceFrame = TEME;
  REF_FRAME_EPOCH:string;
  TIME_SYSTEM:timeSystem = UTC;
  MEAN_ELEMENT_THEORY:meanElementTheory = SGP4;

  // Mean Keplerian Elements in the Specified Reference Frame
  COMMENT:string;
  EPOCH:string;
  SEMI_MAJOR_AXIS:double;
  MEAN_MOTION:double;
  ECCENTRICITY:double;
  INCLINATION:double;
  RA_OF_ASC_NODE:double;
  ARG_OF_PERICENTER:double;
  MEAN_ANOMALY:double;
  GM:double;

  // Spacecraft Parameters
  MASS:double;
  SOLAR_RAD_AREA:double;
  SOLAR_RAD_COEFF:double;
  DRAG_AREA:double;
  DRAG_COEFF:double;

  // TLE Related Parameters (This section is only required if MEAN_ELEMENT_THEORY=SGP/SGP4)
  EPHEMERIS_TYPE:ephemerisType = SGP4;
  CLASSIFICATION_TYPE:string;
  NORAD_CAT_ID:uint32;
  ELEMENT_SET_NO:uint32;
  REV_AT_EPOCH:double;
  BSTAR:double;
  MEAN_MOTION_DOT:double;
  MEAN_MOTION_DDOT:double;

  // Position/Velocity Covariance Matrix (6x6 Lower Triangular Form. None or all parameters of the matrix must be given.
  // COV_REF_FRAME may be omitted if it is the same as the metadata REF_FRAME.) 
  COV_REF_FRAME:manCovRefFrame = RSW;
  CX_X:double;
  CY_X:double;
  CY_Y:double;
  CZ_X:double;
  CZ_Y:double;
  CZ_Z:double;
  CX_DOT_X:double;
  CX_DOT_Y:double;
  CX_DOT_Z:double;
  CX_DOT_X_DOT:double;
  CY_DOT_X:double;
  CY_DOT_Y:double;
  CY_DOT_Z:double;
  CY_DOT_X_DOT:double;
  CY_DOT_Y_DOT:double;
  CZ_DOT_X:double;
  CZ_DOT_Y:double;
  CZ_DOT_Z:double;
  CZ_DOT_X_DOT:double;
  CZ_DOT_Y_DOT:double;
  CZ_DOT_Z_DOT:double;

  // User Defined Parameters (all parameters in this section must be described in an ICD). 
  USER_DEFINED_BIP_0044_TYPE:uint;
  USER_DEFINED_OBJECT_DESIGNATOR:string;
  USER_DEFINED_EARTH_MODEL:string;
  USER_DEFINED_EPOCH_TIMESTAMP: double;
  USER_DEFINED_MICROSECONDS: double;
